function convertToForm(formElement){
  var ret = new URLSearchParams();
  for (const pair of new FormData(formElement)) {

    ret.append(pair[0], pair[1]);
  }
  return ret;
}


function getSession(key){
  if (key)
    if (getPrivilege(key) === 'false') return false
  if (Cookie.get('JWT_token')) return Cookie.get('JWT_token').length > 0;
  else return false;
}

function getSidebarState(){

  return localStorage.getItem('sidebarIndex') ? +localStorage.getItem('sidebarIndex') : 0 ;
}

function saveSidebarState(index){
  localStorage.setItem('sidebarIndex', index);
}

function getTimeStringToTimezone(date, timezone){
  if (typeof date !== Object) date = new Date(date)

  let gmt0 = new Date(date.getTime() - ((- (new Date().getTimezoneOffset())) * 60 * 1000 ) );
  let timezoneOffset = Math.abs(timezone) / 60 / 60;
  timezone < 0 ? timezoneOffset = -timezoneOffset : timezoneOffset = '+' + timezoneOffset;
  let newDate = new Date(gmt0.getTime() + (timezone* 1000) )
  // return newDate.toString().slice(0,24) + ' (UTC' + timezoneOffset + ')';
  return date.toString().slice(0,24) + ' (UTC' + timezoneOffset + ')';

}

