function savePrivilege(isCompany, allowAbsence, allowEmployee, allowOffice, allowPosition){
  let allowReport = false, allowPermission = false, allowRole = false;
  if (allowAbsence) {
    allowReport = true;
    allowPermission = true;
  }
  if (isCompany){
    allowAbsence = true;
    allowEmployee = true;
    allowOffice = true;
    allowPosition = true;
    allowReport = true;
    allowPermission = true;
    allowRole = true;
  }
  localStorage.setItem('isCompany', isCompany)
  localStorage.setItem('allowRole', allowRole)
  localStorage.setItem('allowAbsence', allowAbsence);
  localStorage.setItem('allowReport', allowReport);
  localStorage.setItem('allowPermission', allowPermission);
  localStorage.setItem('allowEmployee', allowEmployee);
  localStorage.setItem('allowOffice', allowOffice);
  localStorage.setItem('allowPosition', allowPosition)
}

function getPrivilege(key){
  return localStorage.getItem(key);
}

